contract Gshib is ERC20, Ownable {
    using SafeMath for uint256;

    uint256 public buyFee = 0;
    uint256 public sellFee = 0;
    address public taxWallet;
    mapping (address => bool) public _isWhiteListedFromFee;

    uint256 public maxBuyLimit = 800000 * 10 ** decimals();
    uint256 public maxSellLimit = 800000 * 10 ** decimals();

    IUniswapV2Router02 public immutable uniswapV2Router;
    address public immutable uniswapV2Pair;

    constructor() ERC20("Gshib 2.0", "GSHIB2.0") {
        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(
            0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D
        );
        // CREATE A UNISWAP PAIR FOR THIS NEW TOKEN
        uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory())
            .createPair(address(this), _uniswapV2Router.WETH());
        // SET THE REST OF THE CONTRACT VARIABLES
        uniswapV2Router = _uniswapV2Router;

        // MINT INITIAL SUPPLY
        _mint(msg.sender, 10000000 * 10 ** decimals());

        //Make deployer tax Wallet
        taxWallet = msg.sender;

        //Exclude owner from fees
        _isWhiteListedFromFee[owner()] = true;

    }

    function _transfer(
        address sender,
        address recipient,
        uint256 amount
    ) internal virtual override {
        uint256 transferAmount = amount;

        if(!_isWhiteListedFromFee[sender] && !_isWhiteListedFromFee[recipient]){

        if(sender == uniswapV2Pair){
            require(amount <= maxBuyLimit, "Amount exceeds maxBuy");
        }

        if(recipient == uniswapV2Pair){
            require(amount <= maxSellLimit, "Amount exceeds maxBuy");
        }

        if(buyFee > 0){
        if (sender == uniswapV2Pair) {
            // TRANSACTION FEE
            uint256 fee = (amount * buyFee) / 100;
            transferAmount = amount - fee;
            super._transfer(sender, taxWallet, fee);
        }
        }

        if(sellFee > 0){
        if (recipient == uniswapV2Pair) {
            // TRANSACTION FEE
            uint256 fee = (amount * sellFee) / 100;
            transferAmount = amount - fee;
            super._transfer(sender, taxWallet, fee);
        }
        }
        }
        super._transfer(sender, recipient, transferAmount);
    }

    function whiteListFromFee(address account) public onlyOwner {
        _isWhiteListedFromFee[account] = true;
    }

    function includeInFee(address account) public onlyOwner{
        _isWhiteListedFromFee[account] = false;
    }

    function changeTaxFees(uint256 _buyTax, uint256 _sellTax) public onlyOwner {
        require(_buyTax <= 25, "Tax too high");
        require(_sellTax <= 25, "Tax too high");
        buyFee = _buyTax;
        sellFee = _sellTax;
    }

    function changeTaxWallet(address account) public onlyOwner {
        taxWallet = account;
    }

    function changeLimits(uint256 _maxBuy, uint256 _maxSell) public onlyOwner{
        require(_maxBuy > totalSupply().div(200), "value too low");
        require(_maxSell > totalSupply().div(200), "value too low");
        maxBuyLimit = _maxBuy;
        maxSellLimit = _maxSell;
    }

}
